import React from "react";
import styles from "./DesktopBackground.module.css";
import cardFront from "../images/bg-card-front.png";
import cardBack from "../images/bg-card-back.png";

const Card = () => {
  return (
    <React.Fragment>
      <div>
        <img className={styles.front} src={cardFront} alt="desktop" />
        <img className={styles.back} src={cardBack} alt="desktop" />
      </div>
    </React.Fragment>
  );
};

export default Card;
